// import logo from './logo.svg';
import React, { Component, useEffect, useState } from 'react';
import './App.css';
import Clock from 'react-live-clock';
import WeatherInfo from './weatherinfo';
import { getSunrise, getSunset } from 'sunrise-sunset-js';
import { forecast } from 'forecast-query';



class App extends React.Component {
  state = {
    latitude: null,
    longitude: null,
    temp: null,
    locationName: null,
    country: null,
    humidity: null,
    visibility: null,
    windSpeed: null,
    feelsLike: null,
    minTemp: null,
    maxTemp: null,
    weatherName: null,
    sunrise: null,
    sunset: null
  }

  componentDidMount() {
    if (navigator.geolocation) {
      this.getPostions()
        .then((position) => {
          console.log(position.coords.latitude);
          // this.setState({ latitude: position.coords.latitude })
          this.getWeather(position.coords.latitude, position.coords.longitude)
        })
    }
  }


  // fetchLocationDay = async => {
  //   const today = new DateTime.now();
  //   for (let i = 0; i < 7; i++) {
  //     a
  //   }
  // }

  getPostions = () => {
    return new Promise(function (resolve, reject) {
      navigator.geolocation.getCurrentPosition(resolve, reject);
    });
  };

  getWeather = async (latitude, longitude) => {
    const api = await fetch(
      `https://api.openweathermap.org/data/2.5/weather?lat=${latitude}&lon=${longitude}&units=metric&appid=38ff886a4e3b7104f324a6067130ef6a`
    );

